// define a function that finds the maximum subarray sum of an array of numbers
function f_gold(nums) {
    // create a prefix sum array
    var s = [0].concat(nums.map((sum => v => sum += v)(0)));
    // find the maximum subarray sum using the prefix sum array
    return Math.max.apply(Math, s.slice(1).map(function (val, i) { return Math.max(val, s[s.length - 1] - s[i]); }));
}
